INSERT INTO `result_info` (`id`, `student_id`, `days_present`, `start_height`, `start_weight`, `office_held`, `award`, `end_height`, `end_weight`, `contributions`, `session`, `term`, `class_teacher`, `islamiyya_teacher`, `primary_head`, `islamiyya_head`, `school_head`, `created_at`, `updated_at`) VALUES
(2, 1048, '', '', '', '', '', '', '', '', '2022/2023', '2', '1', '2', '3', '4', '5', '2024-06-19 12:52:18', '2024-06-19 12:57:49'),
(3, 1084, '102', '117', '54', 'Door monitor ', '', '118', '55', 'Active participation ', '2022/2023', '3', 'You have a great progress in your work. Excellent work!', 'Masha Allah ', '', '', '', '2024-07-15 13:42:22', '2024-07-18 11:13:29'),
(4, 1052, '100', '108', '18', 'Weekly class captain ', '', '110', '20', 'Always  ready to lend a helping hand ', '2022/2023', '3', 'Masha Allah. I\'m beaming with pride! You have shown incredible growth and readiness for Grade 1. Keep shining bright! ', 'Hamdallah  is a bright student and a fast learner. May Allah increase your effort ', '', '', '', '2024-07-15 13:46:23', '2024-07-17 09:14:14'),
(5, 1065, '100', '102', '14', '', '', '103', '15', '', '2022/2023', '3', 'Kamal is well behaved and brilliant child in the class, he is also learning things fast. I\'m proud of him. ', 'Kamal is working well independently.', '', 'Barakallahu feekh', '', '2024-07-15 13:47:09', '2024-07-18 10:27:48'),
(6, 1045, '94', '112', '17', '', '', '114', '18', '', '2022/2023', '3', 'Zaynab is very smart and intelligent, she\'s learning fast, quick to answer questions and get it right. But need to work on writing independently. Kindly encourage her writing skills during the holiday. ', 'Zainab is working well independently ', '', '', '', '2024-07-15 13:52:10', '2024-07-16 12:11:06'),
(7, 1047, '98', '95', '14', '', '', '96', '15', '', '2022/2023', '3', 'Khadija.  Learns things a lot and remember them for a longer period.  But need to work hard on blending, reading and identification. ', 'Khadija. Suleman learned to listen batter and paying attention in class.', '', 'Barakallahu feekh', '', '2024-07-16 02:06:28', '2024-07-18 10:24:47'),
(8, 1041, '102', '120', '488', 'Class captain ', '', '122', '489', 'Bringing innovative ideas and creating solutions to problems or project in the class ', '2022/2023', '3', 'Impressive effort and excellent results keep striving for greatness ', 'May Allah grant you a beneficial Knowledge ', '', '', '', '2024-07-16 02:10:44', '2024-07-18 11:14:15'),
(9, 1057, '100', '11', '16', '', '', '12', '17', '', '2022/2023', '3', 'Abdullahad is an energetic student I had in my class, his performance has improved, but having challenged with effective bleeding and reading, he also lack concentration during lesson.  I suggest he should be engaged in some reading activities during the holiday. ', 'Abdullah shows interest and enthusiasm for classroom activities and seems to enjoy learning.', '', 'Barakallahu feekh', '', '2024-07-16 02:14:53', '2024-07-18 10:25:49'),
(10, 1044, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2022/2023', '3', 'Your enthusiasm for learning is contagious keep it up ', 'May Allah grant you a beneficial Knowledge ', '', '', '', '2024-07-16 02:18:41', '2024-07-18 11:16:00'),
(11, 1051, '102', '115', '47', 'Line leader ', '', '117', '48', 'Collaboration ', '2022/2023', '3', 'You are always eager to participate in class discussion well done ', 'May Allah grant you a beneficial Knowledge.', '', '', '', '2024-07-16 02:23:50', '2024-07-18 11:18:17'),
(12, 1098, '102', '93', '14', '', '', '94', '16', '', '2022/2023', '3', 'Muhammad  is positive, confident and very supportive member of the class. He completes every assigned work on time with focus. Especially  home works.   I would like him to keep up the good work in his new class.  In sha Allah. ', 'Muhammad shows interest and enthusiasm for classroom activities and seems to enjoy learning.', '', 'Barakallahu feekh', '', '2024-07-16 02:30:52', '2024-07-18 10:33:53'),
(13, 1059, '102', '115', '50', 'Book helper', '', '117', '52', 'Engaging in class discussion, asking questions and providing answers ', '2022/2023', '3', 'You always listen carefully and follow instructions. great job  ', 'May Allah grant you a beneficial Knowledge.', '', '', '', '2024-07-16 02:31:57', '2024-07-18 11:19:09'),
(14, 1107, '100', '85', '12', '', '', '86', '13', '', '2022/2023', '3', 'Arwa is very confident and speaks very well in front of the whole class, she is improving in all the subjects. But still need to be spending more time reading with an adult everyday. ', 'Arwa she learned to listen batter and paying attention in classroom.', '', 'Barakallahu feekh', '', '2024-07-16 02:36:26', '2024-07-18 10:40:05'),
(15, 1066, '102', '126', '38', 'Class captain ', '', '128', '40', 'Bringing innovative ideas and creating solutions to problems or project in the class ', '2022/2023', '3', 'Your hard work is paying off.keep trying your best you are a role model to your class mates ', 'May Allah grant you a beneficial Knowledge.', '', '', '', '2024-07-16 02:38:21', '2024-07-18 11:19:58'),
(16, 1110, '94', '105', '18', '', '', '106', '19', '', '2022/2023', '3', 'His performance in  all the subjects is improving. Although he\'s still struggling with writing  independently, blending and reading. He could benefit from spending more time reading with an adult. ', 'Muhammad need to memorize his basic writing facts in order to complete complex writing problems more easily.', '', 'Barakallahu feekh', '', '2024-07-16 02:41:31', '2024-07-18 10:37:13'),
(17, 1116, '79', '106', '25', '', '', '107', '26', '', '2022/2023', '3', 'I\'m really impressed by Balqis  performance.  She\'s serious about with her studies. But she needs to work more on speaking loud and clearly in the class. ', '', '', '', '', '2024-07-16 02:45:37', '2024-07-16 12:25:35'),
(18, 1067, '102', '115', '42', 'Line leader ', '', '117', '43', 'Engaging in class discussion, asking questions and providing answers ', '2022/2023', '3', 'Fantastic effort in all your work , keep shining ', 'May Allah grant you a beneficial Knowledge.', '', '', '', '2024-07-16 02:47:15', '2024-07-18 11:20:43'),
(19, 1131, '100', '107', '18', '', '', '108', '19', '', '2022/2023', '3', 'Yasmeen is very engaged in most of the group activities in the class and she is  one of the smart students in the class. I would like her to work on working with less supervision. ', 'Yasmeen is a wonderful helper and a classroom leader.', '', 'Barakallahu feekh.', '', '2024-07-16 02:52:35', '2024-07-18 10:41:50'),
(20, 1093, '94', '115', '46', 'Book helper', '', '117', '45', 'Collaboration ', '2022/2023', '3', 'Your cheerful attitude brightens our classroom, keep it up. An excellent results  well done  girl!', 'You have shown great improvement in your reading skills. Well done.', 'Your creativity and imagination are impressive. Keep exploring.', '', '', '2024-07-16 02:57:56', '2024-07-17 11:34:44'),
(21, 1100, '102', '104', '17.00', '', '', '105', '18.00', '', '2022/2023', '3', 'Rayyan is very engaged in  class activities, but struggled to work independently, and also work on his focus and attention during class instructions, engaged him with calming routines during the holiday. ', 'Rayyan need to show more appropriate behaviour when introducing with classmates.', '', 'Barakallahu feekh', '', '2024-07-16 02:58:31', '2024-07-18 10:35:47'),
(22, 1133, '90', '99', '16', '', '', '100', '17', '', '2022/2023', '3', 'Ahmad is very smart and intelligent boy. But frequently turns in incomplete homework or doesn\'t hand in  any.  Please encouraging him to complete his works would be very helpful. ', 'Ahmad is needs to memorize her basic reading facts in order to complete complex reading problems more easily.', '', 'Barakallahu feekh.', '', '2024-07-16 03:03:53', '2024-07-18 10:50:26'),
(23, 1135, '94', '102', '16', '', '', '103', '17', '', '2022/2023', '3', 'Abdullahi is a very hard working student,  he participates actively in class.  But need to work on writing independently. ', 'Abdullah Is an active listener who is always ready to respond with relevant and engaging questions.', 'Barakallahu feekh.', 'Barakallahu feekh', '', '2024-07-16 03:06:58', '2024-07-18 10:46:13'),
(24, 1136, '70', '100', '13', '', '', '101', '14', '', '2022/2023', '3', 'Her performance in some subjects is improving. But still need more practice in blending, reading and identification skills. ', '', '', '', '', '2024-07-16 03:11:23', '2024-07-16 12:30:07'),
(25, 1137, '88', '97', '16', '', '', '98', '17', '', '2022/2023', '3', 'Musa is very hard working and supportive student in our class. He asked questions when needed. Although he\'s having difficulties in his pronunciation and speaking. Kindly engage him more in  speaking English during the holiday. ', 'Musa is very good at reflecting on her weaknesses and working no them.', '', 'Barakallahu feekh.', '', '2024-07-16 03:17:10', '2024-07-18 10:45:09'),
(26, 1205, '98', '107', '16', '', '', '108', '17', '', '2022/2023', '3', 'Such a great pleasure to have a student like you  Khadija.  She spends time thinking and  choosing the right words to respond to anything concerning her studies. Kindly encourage her on reading more during the holiday. ', 'Khadija is very good at reflecting on her weaknesses and working on them.', '', 'Barakallahu feekh', '', '2024-07-16 03:23:53', '2024-07-18 10:19:35'),
(27, 1054, '94', '121', '24', 'Weekly class captain ', '', '125', '25', 'Always ready to lend a helping hand', '2022/2023', '3', 'Masha Allah! Well done , nursery super star!  You have  mastered the basics and you are now ready to soar in Grade 1. Keep reaching for the stars my jewel! ', 'She is a great student and fast learner but she needs to shift her focus a little towards. May allah increase your effort.', '', '', '', '2024-07-16 07:34:50', '2024-07-17 09:22:32'),
(28, 1119, '94', '110', '20', 'Weekly Class captain ', '', '115', '22', 'Always ready to lend a helping hand', '2022/2023', '3', 'Well done my boy,  the nursery superstar! You have mastered the basics and you are now ready to soar in Grade 1. Keep reaching for the stars! ', 'He has developed a better understanding of hadeeth and recitation of qur\'an this term. Alhamdulillah.keep it up.', '', 'Barakhallahu  feekh. ', '', '2024-07-16 07:49:28', '2024-07-17 10:30:36'),
(29, 1099, '102', '136', '31', 'Class  representative', '', '138', '32', 'Active participation ', '2022/2023', '3', 'You are a very polite and respectful to everyone in class. Great job ', 'May Allah grant you a beneficial Knowledge.', '', '', '', '2024-07-16 08:19:50', '2024-07-18 11:22:42'),
(30, 1062, '100', '100', '18', 'Weekly Class Captain ', '', '105', '19', 'Always ready to lend a helping hand ', '2022/2023', '3', 'What an achievement! Masha Allah! You have learned, played, and flourished in kindergarten, get ready for the next adventure in grade 1!', ' She is always willing to learn. Need to practice reading at home every day to help. Make her a stronger reader ', '', 'Barakhallahu feekh. ', '', '2024-07-16 09:17:43', '2024-07-17 09:41:17'),
